import React from "react";
import SHOP_DATA from "./ShopData";
import CollectionsPreview from "../../Components/CollectionsPreview/CollectionsPreview";
import WithSpinner from "../../Components/WithSpinner/WithSpinner";
import { Route } from "react-router-dom";
const WithSpinnerCollectionOverView = WithSpinner(CollectionsPreview);

class ShopPage extends React.Component {
  constructor() {
    super();
    this.state = {
      collections: SHOP_DATA,
      loading: true,
    };
  }

  componentDidMount() {
    this.setState({ loading: false });
  }

  render() {
    const { collections } = this.state;
    return (
      <div className="shop-page">
        <Route exact path={`${match.path}`} component={CollectionsPreview} />
      </div>
    );
  }
}

export default ShopPage;
